import React from 'react';
import styles from './styles.css';


const AboutUs = () => {
    return (
        <section className='section-container'>
            <h2 className='sectionTitle'>About us</h2>
            <p className='sectionText'>
            Somos un club deportivo, inicialmente dedicado a la práctica de kayak 
            y también de Stand up paddle y botes a pedal.
            Cumpliendo con las medidas de seguridad necesarias podrás pasar una tarde 
            de forma muy divertida y de forma segura junto a nosotros.
            </p>
        </section>
    )
}

export default AboutUs;
